import React from "react";

const CustomerList = ({ customers, onViewCustomer, onDeleteCustomer }) => {
  return (
    <div>
      <h2>Customer List</h2>
      <ul>
        {customers.map((customer) => (
          <li key={customer.id}>
            {customer.name}{" "}
            <button onClick={() => onViewCustomer(customer)}>View</button>{" "}
            <button onClick={() => onDeleteCustomer(customer.id)}>Delete</button>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default CustomerList;
